criteria.textblock:
Inclusion Criteria:
Participants are eligible to be included in the study only if the following conditions are met:
1. Male or female aged ≥18 years old when signing ICF;
2. Participants that were fully vaccinated with inactivated anti-SARS-CoV-2 vaccine, and the last dose is ≥6 months away from the vaccination of this study.
3. Participants that can sign written ICF and voluntarily participate in the trial, and can fully understand the trial procedure, the risk of participating in the trial, and other interventions that can be selected if they do not participate in the trial;
4. Ability to read, understand, and fill in record cards;
5. Phase I participants only: Those who are clinically judged to be healthy, the results of physical examination, vital signs and laboratory tests during the screening period are normal, or although beyond the normal reference range, they are judged by investigators to be of no clinical significance;
6. Phase II/III participants only: Healthy participants or participants with pre-existing medical conditions who are in stable condition. A stable medical condition is defined as disease not requiring significant change in therapy or no need for hospitalization as a consequence of worsening disease state for at least 3 months prior to enrollment;
7. Fertile men and women of childbearing age voluntarily agree to take effective contraceptive measures from signing ICF to 6 months after the study vaccination; the pregnancy test results of women of childbearing age are negative on screening.
Exclusion Criteria:
A participant who conforms to any of the following criteria should not be enrolled in the study:
1. Previous diagnosis of COVID-19;
2. Phase I participants only: high-risk populations (such as medical workers, close contacts of patients with COVID-19 infection, etc.) who are more likely to be infected with SARS-Cov-2;
3. Presence of fever within or 72 h before the study vaccination (axillary temperature ≥ 37.3℃);
4. A history of infection or disease related to severe acute respiratory syndrome (SARS), Middle East respiratory syndrome (MERS), or corresponding immunosuppressants;
5. A history of allergic reactions to any vaccine or drug, such as allergy, urticaria, severe skin eczema, dyspnea, laryngeal edema, and angioneurotic edema;
6. A medical or family history of seizure, epilepsy, encephalopathy and psychosis;
7. Immunocompromised patients suffering from immunodeficiency diseases, important organ diseases, immune diseases (including Guillain-Barre Syndrome [GBS], systemic lupus erythematosus, rheumatoid arthritis, asplenia or splenectomy caused by any circumstances, and other immune diseases that may have an impact on immune response in the investigator's opinion), etc.;
8. Long-term use of immunosuppressant therapy or immunomodulatory drugs for ≥14 days within the first six months prior to enrollment, or plan to use immunosuppressant therapy or immunomodulatory drugs within two years after enrollment. Whereas short-term (≤14 days) use of oral, inhaled and topical steroids are allowed.
9. Patients on antituberculosis therapy;
10. Phase I participants only: Previously or currently suffering from clinically significant cardiovascular diseases (except for the hypertension that can be controlled with drugs), or clinically significant disorders related to respiratory system, liver and kidney (except for light fatty liver), gastrointestinal system (except for chronic gastritis), endocrine system, blood and lymphatic system, metabolic and skeletal systems, or malignancies (except for skin basal cell carcinoma and carcinoma in-situ of cervix), that may affect the study assessment, or cause risks during the study vaccination, or interfere with the data interpretation as determined by the investigator; Phase II/III participants only: Presence of severe or uncontrollable cardiovascular diseases, or severe or uncontrollable disorders related to endocrine system, blood and lymphatic system, liver and kidney, respiratory system, metabolic and skeletal systems, or malignancies (except for skin basal cell carcinoma and carcinoma in-situ of cervix);
11. Contraindications for intramuscular injection or intravenous blood sampling, including thrombocytopenia and other blood coagulation disorders;
12. Participants who received any immunoglobulin or blood products in the previous 3 months, or plan to receive similar products during the study;
13. Participants who received other registered investigational drugs of intervention within 1 month before the study vaccination;
14. Participants vaccinated with influenza vaccine within 14 days or with other vaccines within 28 days before the study vaccination;
15. Those who donated blood or had blood loss (≥450 mL) within 3 months before the vaccination or plan to donate blood during the study period;
16. Those who are pregnant or breast-feeding or plan to be pregnant during the study period;
17. Those who plan to donate ovum or sperms during the study period;
18. Those who cannot follow the trial procedures, or cannot cooperate to complete the study due to planned relocation or long-term outing;
19. Those unsuitable for participating in the clinical trial as determined by the investigator because of other abnormalities that are likely to confuse the study results, or non-conformance with the maximal benefits of the participants;
20. Phase I participants only: those who are tested positive for hepatitis B virus (HBV), hepatitis C virus (HCV), syphilis or HIV in terms of serology; Phase II/III participants only: those who are tested positive for HIV in terms of serology.
